import React, { useState } from "react";
import {Container, Row, Col} from 'react-bootstrap'
import { AddticketForm } from "../../components/Addticketform/addticketform";
import { PageBreadcrumb } from "../../components/breadcrumb/Breadcrumb";
const initialfrmdt = {
    subject:'',
    issueDate:null,
    details:''
}
export const Addtickets = ()=>{
    const [frmdata, setfrmdata] = useState(initialfrmdt)
    const handleOnChange = (e) =>{
        const {name, value } = e.target;
        setfrmdata({...initialfrmdt, 
        [name]:value,
        })
    };
    return(<Container>
        <Row>
            <Col>
                <PageBreadcrumb page='New Tickets'></PageBreadcrumb>
            </Col>
        </Row>
        <Row>
            <Col>
                <AddticketForm handleOnChange={handleOnChange}></AddticketForm>
            </Col>
        </Row>
    </Container>
    )
}
